import { useRef } from "react";
import {FaBars, FaTimes} from "react-icons/fa";

function NavigationBar () {
    return (
      <header>
        <Nav>
          <a href=""></a>
          <button>
            <FaTimes/>
          </button>
        </Nav>
        <button>
          <FaBars/>
        </button>
      </header>
    );
}
export default NavigationBar;
